import React from "react";

import Navbar from "../Components/navbar/Navbar.js";
import Totaldata from "../Components/totaldata/totaldata";
import Centreelement from "../Components/centerelement/centreelement.js";
import Projectdetails from "../Components/projectdetails/projectdetails.js";

import projectcompletedlogo from "../Assests/images/projectcompletedlogo.svg";
import runningprojectlogo from "../Assests/images/runningprojectlogo.svg";
import pipelineprojectlogo from "../Assests/images/pipelineprojectlogo.svg";
import supportrequiredlogo from "../Assests/images/supportrequiredlogo.svg";

import "../Pages/homepage.scss";

function Homepage() {
  const tilesData = [
    {
      title: "Project completed",
      cardIcon: projectcompletedlogo,
      count: 10,
    },
    {
      title: "Running project",
      cardIcon: runningprojectlogo,
      count: 20,
    },
    {
      title: "Pipeline project",
      cardIcon: pipelineprojectlogo,
      count: 20,
    },
    {
      title: "Support required",
      cardIcon: supportrequiredlogo,
      count: 20,
    },
  ];
  // const projectdata = [
  //   {
  //     logo: ,
  //     count: 11,
  //   },
  //   {
  //     logo: ,
  //     count: 11,
  //   },
  //   {
  //     logo: ,
  //     count: 11,
  //   },
  //   {
  //     logo:,
  //     count: 11,
  //   },
  // ];

  return (
    <div className="home-container">
      <Navbar />
      <div className="tiles-container">
        {tilesData && tilesData.map((item) => <Totaldata {...item} />)}
      </div>
      <Centreelement />
    </div>
  );
}

export default Homepage;
